import React, { useEffect, useState } from 'react'
import axios from 'axios'

export const Admin = () => {


    const [user, setUser] = useState(null);

    useEffect(() => {
    
        axios.get('http://localhost:5000/admin', {withCredentials: true})
        .then(res => {

            const users = [];
            const data = res.data
            for (const key in data) {
                users.push({
                    id: key,
                    name: data[key].name, 
                    email: data[key].email, 
                    date: data[key].date
                })
            }

            setUser(users)
        })
      }, [])

      if (user) {
          console.table(user)
      }

      const tableData = () => {

        return user ? user.map((users, index) => {
            return (
                <tr key={index}>
                    <td className='p-2 bg-white border border-gray-400'>{users.name}</td>
                    <td className='p-2 bg-white border border-gray-400'>{users.email}</td>
                    <td className='p-2 bg-white border border-gray-400'>{users.date}</td>
                </tr>
            )
        }) : null
      }

    return (
        <div className='w-full h-full flex flex-col justify-center items-center text-left'>
            <h1 className='text-4xl font-semibold'>Users</h1>

            <table className='w-2/4 m-auto bg-gray-100 text-center rounded-md mt-10'>
                <thead>
                    <tr className='w-40'>    
                            <th className='px-5 py-2'>NAME</th>
                            <th>EMAIL</th>
                            <th>DATE</th>
                    </tr>
                </thead>

                <tbody>
                    {tableData()}
                </tbody>

            </table>
        </div>
    )
}
